import { Route, BrowserRouter as Router, Switch } from "react-router-don";
import Login from "./screens/Login.jsx";

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route path="/login" component={Login} />
      </Switch>
    </Router>
  );
};

export default App;
